const PreviewPage = (props) => {
  const { userData } = props;
  return (
    <div className="PreviewPage">
      <ul className="dataListForm">
        <li name="userName">성명: {userData.userName}</li>
        <li name="userAddr">주소: {userData.userAddr}</li>
        <li name="userTel">연락처: {userData.userTel}</li>
        <li name="userComment">소개: {userData.userComment}</li>
      </ul>
    </div>
  );
};
export default PreviewPage;
